            {id:2 ,name: "Jon Snow", age: 23, address:"the night watcher"},
            {id:3 ,name: "Sansa Stark", age: 21, address:"winterfell"},
            ]
        return(
            <div>
                <UserIn4/>
                <hr></hr>
                <Displayin4 name = {paratheon[0]} age={30} death ="pig's bite"/>
                <hr></hr>
                <Displayin4 lannisters={this.state.lannisterFamily}/>
                <hr></hr>
                <Displayin4 lannisters={starkFamily}/>
           </div>
       );
   }
}
export default MyComponent;
